import React from 'react'
import Nav from './Nav';

type Props = {
    children: string
}

export default function TopSection({ children }: Props) {
  return (
    <>
        <Nav />
        <div className="w-full h-screen bg-[url('../resources/final.png')] bg-cover bg-center flex justify-center items-center" >
            {children}
        </div>
    </>
  );
}
